var pn={id:"structured_outputs_samples",title:"Structured Outputs Sample Apps",description:"A collection of examples of how to use structured outputs.",img:"https://cdn.openai.com/examples/structured_outputs_samples.png",type:"repo",link:"https://github.com/openai/openai-structured-outputs-samples",details:"Structured Outputs is an OpenAI API feature that ensures responses and tool calls adhere to a defined JSON schema. This makes building with our models more reliable, bridging the gap between unpredictable model outputs and deterministic workflows.\nThis repository contains a collection of sample apps showcasing the use of Structured Outputs:\n  - Resume Extraction\n    This app is a simple example of how to use Structured Outputs in model responses to display information in a structured format.\n  - Generative UI\n    This app focuses on generating UI components on the fly with Structured Outputs.\n  - Conversational Assistant\n    This app is a more complex example that combines multi-turn conversations, tool calling and generative UI. You can use this as a starting point to build an assistant with reliable workflows. \nEach app demonstrates practical ways to leverage this feature to build applications with NextJS.\n"},ZA=pn.id,XA=pn.title,JA=pn.description,KA=pn.img,QA=pn.type,eI=pn.link,tI=pn.details;
